import React from "react";

function add (a,b){
    let total = a+b
    return total
}


function min (a,b){
    let total = a-b
    return total
}



function mul (a,b){
    let total = a*b
    return total
}




function div (a,b){
    let total = a/b
    return total
}

export {add, min, mul, div};
